import React from 'react';
import classes from './IdintetyList.module.css';

const IdintetyList = (props) => {
  const deleteHandeler = (id) => {
    props.onDelete(id);
  };

  const updateHandeler = (id) => {
    const newName = prompt('Enter A New Name: ');

    fetch('http://localhost:3001/update', {
      method: 'PUT',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({
        newName: newName,
        id: id,
      }),
    });
  };

  return (
    <section>
      {props.idintetyInfo.map((info) => (
        <div className={classes.list_group}>
          <h1>{info.name}</h1>
          <h2>{info.age}</h2>
          <h2>{info.hobbies}</h2>
          <p> {info._id}</p>
          <div className={classes.list_action}>
            <button
              onClick={() => deleteHandeler(info._id)}
              className={classes.danger}
            >
              DELETE
            </button>
            <button
              onClick={() => updateHandeler(info._id)}
              className={classes.primary}
            >
              EDIT
            </button>
          </div>
        </div>
      ))}
    </section>
  );
};

export default IdintetyList;
